import React from 'react';

class ClassComponent extends React.Component {
    constructor() {
        super();
        this.state = {
            course: "React Native",
        }
    }
    render() {
        return <h2>My favourite course is {this.state.course}</h2>
    }
}

export default ClassComponent;
